import React, { Component } from "react";
import styled from "styled-components";

class Inputs extends Component {
  render() {
    const Div_inputs_outline = styled.div`
    width: 1112px;
    height: 296px;
    margin: 0 auto;
    position: relative;
    top: -624px;
    `;



    return (
      <div>
        <Div_inputs_outline>
        Hello world
        </Div_inputs_outline>
      </div>
    );
  }
}

export default Inputs;
